import React, { useState } from "react";
const App = () => {
  let time = new Date().toLocaleTimeString();
  const [ctime, setctime] = useState(time);

  return (
    <React.Fragment>
      <h1>{ctime}</h1>
    </React.Fragment>
  );
};
export default App;
